from collections import Counter
from sortedcontainers import SortedList

class Solution:
    def canConstruct(self, s: str, k: int) -> bool:
        '''
           s = 'aabaamn' ; k = 3 => ('aabaa','m','n')
           s = 'aabbcc'  ; k = 4 => True
           The logic here is to take care of some trivial cases first.
           Then we use a greedy approach. Let S = count of distinct characters in s.
           A) If k > S, then we pick 1 character each time as we reduce k to 1.
           B) If k < S, then we remove each character each time as we reduce k to 1.
           Finally, when k = 1, we check the condition for a palindrome, which is:
           -  either there is just one character, its freq doesn't matter, or
           -  there is at the most one odd freq from all multiple character frequencies
           If one of the two conditions are satisfied, we return True. Otherwise False.
        '''
        N = len(s)
        if k == N:
            return True
        if k > N:
            return False
        S = len(set(s))
        if S == 1:
            if N >= k:
                return True
            return False
        cntr = Counter(s)
        if k == S:
            return True
        sl = SortedList([(-(v%2), v) for k, v in cntr.items()])
        #print(sl)
        if k > S:
            while k > 1:
                p, v = sl.pop(0)
                v -= 1
                p = -(v % 2)
                if v > 0:
                    sl.add((p, v))
                k -= 1
                #print(f'\tk, sl = {k}, {sl}')
            vals = [v for p, v in sl if v != 0]
            #print(f'\t\tsl, vals = {sl}, {vals}')
            if len(vals) == 1:
                return True
            if sum([v % 2 == 1 for v in vals]) > 1:
                return False
            return True
        if k < S:
            i = 0
            while k > 1:
                p, v = sl.pop(0)
                v = 0
                p = -(v % 2)
                if v > 0:
                    sl.add((p, v))
                k -= 1
            vals = [v for p, v in sl if v != 0]
            #print(f'\t\tsl, vals = {sl}, {vals}')
            if len(vals) == 1:
                return True
            if sum([v % 2 == 1 for v in vals]) > 1:
                return False
            return True

